import ExpenseItem from "./components/ExpenseItems";

function App() {
  const expenses = [
    { title: "Car Insurance", amount: 335.67, date: new Date(2021, 2, 28) },
    { title: "Toilet Paper", amount: 234.67, date: new Date(2021, 6, 28) },
    { title: "Wodden Desk", amount: 766.67, date: new Date(2021, 8, 28) },
    { title: "Gym Membership", amount: 686.67, date: new Date(2021, 1, 23) },
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem
        title={expenses[0].title}
        amount={expenses[0].amount}
        date={expenses[0].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expenses[1].title}
        amount={expenses[1].amount}
        date={expenses[1].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expenses[2].title}
        amount={expenses[2].amount}
        date={expenses[2].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expenses[3].title}
        amount={expenses[3].amount}
        date={expenses[3].date}
      ></ExpenseItem>
    </div>
  );
}

export default App;
